class Solution:
    def numFactoredBinaryTrees(self, arr):
        MOD = 10**9 + 7
        arr.sort()
        dp = {}
        for x in arr:
            dp[x] = 1
        index = {x: i for i, x in enumerate(arr)}
        for i, x in enumerate(arr):
            for j in range(i):
                if x % arr[j] == 0:
                    right = x // arr[j]
                    if right in dp:
                        dp[x] += dp[arr[j]] * dp[right]
                        dp[x] %= MOD
        return sum(dp.values()) % MOD
